import axios from "axios";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import "./SignUp.css";
import { setEmail, setLoading, setName, setPassword } from "./authSlice.js";

function SignUp() {
  const navigate = useNavigate();
  const { first, email, password, loading } = useSelector(
    (state) => state.mySlice
  );
  const dispatch = useDispatch();

  useEffect(() => {
    let accessToken = localStorage.getItem("accessToken");
    if (accessToken) {
      navigate("/Home");
    }
  }, []);
  function SignupFun(accessToken) {
    localStorage.setItem("accessToken", accessToken);
    navigate("/Home");
  }

  const saveData = () => {
    const data = new FormData();
    data.append("name", "Nitesh");
    data.append("email", "Nitesh*e77");
    console.log(data);
  };

  const saveUser = async () => {
    try {
      saveData();
      return;
      // setLoading(true);
      let frm = new FormData();
      console.log(first, email, password);
      frm.append("name", "nitesh");
      frm.append("email", "emsinghail");
      frm.append("password", "paadfadfssword");

      console.log(frm);

      let reqOptions = {
        url: "https://4zjnw94s-3131.inc1.devtunnels.ms/auth/signup",
        method: "POST",
        data: "",
      };

      let { data } = await axios.request(reqOptions);
      setLoading(false);
      //console.log(response.data);
      if (data.success) {
        SignupFun(data.accessToken);
      } else {
        alert(data.message);
      }
    } catch (e) {
      console.log(e);
    }
  };
  return (
    <div className="Body-2">
      {loading ? (
        <div className="loader-container">
          <div className="spinner"></div>
        </div>
      ) : (
        <form className="form-2">
          <div className="title-2">
            <h1>Sign Up</h1>
            <p>to make your time productive ✌️</p>
          </div>
          <div className="form-content2">
            <div className="fullname">
              <label htmlFor="firstname" className="req-2">
                First Name
              </label>
              <input
                type="text"
                id="firstname"
                name="first"
                className="input-2"
                value={first}
                onChange={(e) => {
                  // setFirst(e.target.value);
                  dispatch(setName(e.target.value));
                }}
                required
              />

              <label htmlFor="LastName" className="re">
                Last Name
              </label>
              <input
                type="text"
                id="LastName"
                name="last"
                className="input-2"
                // value={last}
              />
            </div>

            <label htmlFor="email-1" className="req-2">
              Email Address
            </label>
            <input
              type="email"
              id="email-1"
              name="email"
              className="input-2"
              value={email}
              onChange={(e) => {
                // setEmail(e.target.value);
                dispatch(setEmail(e.target.value));
              }}
              required
            />
            <br></br>
            <br></br>

            <label htmlFor="password-1" className="req-2">
              Password
            </label>
            <input
              type="text"
              id="password-1"
              name="password-1"
              className="input-2"
              value={password}
              onChange={(e) => {
                // setPassword(e.target.value);
                dispatch(setPassword(e.target.value));
              }}
              required
            />

            <div className="button-su">
              <button type="button" className="btn-2" onClick={saveUser}>
                Sign Up
              </button>
            </div>
            <div className="link-2">
              <p>
                Already a user?<Link to="/Login">Login</Link>
              </p>
              <br></br>
            </div>
          </div>
        </form>
      )}
    </div>
  );
}
export default SignUp;
